import * as React from "react";
import Button from "@mui/material/Button";
import { styled } from "@mui/material";

function App() {
  const GreenBtn = styled(Button)({
    backgroundColor: "green",
    color: "blueviolet",
    "&:hover": {
      backgroundColor: "yellow",
    },
    "&:active": {
      backgroundColor: "red",
    },
  });

  return (
    <div className="App">
      <Button variant="text" color="error">
        Text
      </Button>
      <Button
        variant="contained"
        sx={{
          backgroundColor: "red",
          color: "blueviolet",
          "&:hover": {
            backgroundColor: "pink",
          },
          "&:active": {
            backgroundColor: "black",
          },
        }}
      >
        Contained
      </Button>
      <Button
        href="https://www.youtube.com/"
        color="secondary"
        variant="outlined"
        target="new"
      >
        GOOGLE
      </Button>

      <GreenBtn> </GreenBtn></div>
  );
}

export default App;
